/**
 * @param {string} s
 * @return {number}
 */
var maxOperations = function(s) {
  const n = s.length;
  let res = 0, ones = 0;
  for (let i = 0; i < n - 1; i++) {
    if (s[i] === '1') {
      ones++;
      if (s[i+1] === '0') {
        res += ones;
      }
    }
  }
  return res;
};
